        "description": {
          "description": "\u003cp\u003eThis opcode implements a formula for generating a normalised logarithmic curve in range 0 - 1. It is based on the Max / MSP work of Eric Singer (c) 1994.\n\u003c/p\u003e\u003cp\u003eGenerates a logarithmic curve in range 0 to 1 of arbitrary steepness.\n       Steepness index equal to or lower than 1.0 will result in Not-a-Number\n       errors and cause unstable behavior.\n\u003c/p\u003e\u003cpre\u003e kout  logcurve  kindex, ksteepness\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/logcurve.html\u003c/a\u003e\n\u003c/p\u003e",
          "module": "Csound.Typed.Opcode.SignalGenerators",
          "name": "logcurve",
          "package": "csound-expression-opcodes",
          "signature": "Sig -\u003e Sig -\u003e Sig",
          "source": "src/Csound-Typed-Opcode-SignalGenerators.html#logcurve",
          "type": "function"
        },
