          "description": "\u003cp\u003eA linearly interpolated oscillator that allows changing the table number at k-rate.\n\u003c/p\u003e\u003cp\u003eoscilikt is very similar to oscili, but allows changing the table number at k-rate. It is slightly slower than oscili (especially with high control rate), although also more accurate as it uses a 31-bit phase accumulator, as opposed to the 24-bit one used by oscili.\n\u003c/p\u003e\u003cpre\u003e ares  oscilikt  xamp, xcps, kfn [, iphs] [, istor]\n kres  oscilikt  kamp, kcps, kfn [, iphs] [, istor]\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/oscilikt.html\u003c/a\u003e\n\u003c/p\u003e",
