          "description": "\u003cp\u003eDistributes an input signal among 4 channels using cartesian coordinates.\n\u003c/p\u003e\u003cp\u003espace takes an input signal and distributes it among 4 channels using Cartesian xy coordinates to calculate the balance of the outputs. The xy coordinates can be defined in a separate text file and accessed through a Function statement in the score using Gen28, or they can be specified using the optional kx, ky arguments. The advantages to the former are:\n\u003c/p\u003e\u003cpre\u003e a1, a2, a3, a4   space  asig, ifn, ktime, kreverbsend, kx, ky\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/space.html\u003c/a\u003e\n\u003c/p\u003e",
