          "description": "\u003cp\u003eReads from a phase vocoder analysis file and makes the retrieved data available.\n\u003c/p\u003e\u003cp\u003epvbufread reads from a pvoc file and makes the retrieved data available to any following pvinterp and pvcross units that appear in an instrument before a subsequent pvbufread (just as lpread and lpreson work together). The data is passed internally and the unit has no output of its own.\n\u003c/p\u003e\u003cpre\u003e  pvbufread  ktimpnt, ifile\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/pvbufread.html\u003c/a\u003e\n\u003c/p\u003e",
