          "description": "\u003cp\u003eReads from a phase vocoder analysis file and returns the frequency and amplitude from a single analysis channel or bin.\n\u003c/p\u003e\u003cp\u003epvread reads from a pvoc file and returns the frequency and amplitude from a single analysis channel or bin. The returned values can be used anywhere else in the Csound instrument. For example, one can use them as arguments to an oscillator to synthesize a single component from an analyzed signal or a bank of pvreads can be used to resynthesize the analyzed sound using additive synthesis by passing the frequency and magnitude values to a bank of oscillators.\n\u003c/p\u003e\u003cpre\u003e kfreq, kamp  pvread  ktimpnt, ifile, ibin\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/pvread.html\u003c/a\u003e\n\u003c/p\u003e",
