          "description": "\u003cp\u003eFreeze the amplitude and frequency time functions of a pv stream according to a control-rate\n       trigger.\n\u003c/p\u003e\u003cp\u003eThis opcodes \u003ccode\u003efreezes\u003c/code\u003e the evolution of pvs stream by locking into steady amplitude and/or\n       frequency values for each bin. The freezing is controlled, independently for amplitudes and\n       frequencies, by a control-rate trigger, which switches the freezing \u003ccode\u003eon\u003c/code\u003e if equal to or above\n       1 and \u003ccode\u003eoff\u003c/code\u003e if below 1.\n\u003c/p\u003e\u003cpre\u003e fsig  pvsfreeze  fsigin, kfreeza, kfreezf\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/pvsfreeze.html\u003c/a\u003e\n\u003c/p\u003e",
