          "description": "\u003cp\u003eInstantaneous Frequency Distribution, magnitude and phase analysis.\n\u003c/p\u003e\u003cp\u003eThe pvsifd opcode takes an input a-rate signal and performs an Instantaneous Frequency,\n   magnitude and phase analysis, using the STFT and pvsifd (Instantaneous Frequency Distribution),\n   as described in Lazzarini et al, \u003ca\u003eTime-stretching using the Instantaneous Frequency Distribution and Partial\n   Tracking\u003c/a\u003e, Proc.of ICMC05, Barcelona. It generates two PV streaming signals, one containing the\n   amplitudes and frequencies (a similar output to pvsanal) and another containing amplitudes and \n   unwrapped phases.\n\u003c/p\u003e\u003cpre\u003e ffr,fphs  pvsifd  ain, ifftsize, ihopsize, iwintype[,iscal]\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/pvsifd.html\u003c/a\u003e\n\u003c/p\u003e",
