          "description": "\u003cp\u003eStreaming partial track additive synthesis\n\u003c/p\u003e\u003cp\u003eThe tradsyn opcode takes an input containg a TRACKS pv streaming signal (as generated,\n       for instance by partials),as described in Lazzarini et al, \u003ca\u003eTime-stretching using the Instantaneous Frequency Distribution and Partial\n       Tracking\u003c/a\u003e, Proc.of ICMC05, Barcelona. It resynthesises the signal using linear amplitude and frequency\n       interpolation to drive a bank of interpolating oscillators with amplitude and pitch scaling controls.\n\u003c/p\u003e\u003cpre\u003e asig  tradsyn  fin, kscal, kpitch, kmaxtracks, ifn\n\u003c/pre\u003e\u003cp\u003ecsound doc: \u003ca\u003ehttp://www.csounds.com/manual/html/tradsyn.html\u003c/a\u003e\n\u003c/p\u003e",
